import Hash from './components/Hash';
import Block from './components/Block/Block';
import Blockchain from './components/Blockchain/Blockchain';
import Distributed from './components/Distributed/Distributed';
import Tokens from "./components/Tokens/Tokens";
import Coinbase from "./components/Coinbase/Coinbase";
import { TitleField, BodyField } from './components/Fields';
import React from 'react';
import description from './components/Blockchain/description';
import Section from './components/Section';
import { hash, block, blockchain } from './descriptions/descriptions'

class App extends React.Component {

    render() {
        return (
            <div className="App">
                <Section
                    title={hash.title}
                    body={hash.body}
                    component={<Hash />}
                />
                <Section 
                    title={block.title}
                    body={block.body}
                    component={<Block />}
                />
                <Section 
                    title={blockchain.title}
                    body={blockchain.body}
                    component={<Blockchain />}
                />
                <div className="Distributed">
                    <Distributed />
                </div>
                <div className="Tokens">
                    <Tokens />
                </div>
                    <div className="Coinbase">
                <Coinbase />
            </div>

            </div>
        );
    }
}

export default App;
